description:
Star Wars: Episode I - The Phantom Menace (1999) 

Verenigde Staten
Science-Fiction / Fantasy
133 minuten

geregisseerd door George Lucas
met Liam Neeson, Ewan McGregor en Natalie Portman

Wanneer de slechte Trade Federation van plan is om de vredige planeet Naboo 
te veroveren, moet de Jedi-strijder Qui-Gon Jinn samen met zijn leerling Obi-Wan 
Kenobi proberen dit te voorkomen. Zij krijgen hulp van de jonge Koningin Amidala, 
en de Gungan Jar Jar Binks. Tijdens hun avontuur komen ze terecht op de planeet 
Tatooine, waar ze de jonge Anakin Skywalker tegenkomen. Qui-Gon en Obi-Wan zien 
in hem een mogelijk Jedi, en willen 'm gaan trainen.
